const prepareSummary = (value:string | undefined) => {  
    // if (value) return value.replace(/<\/?[a-zA-Z]+>/gi,'');
    // else return 'Фильмец классный';

    return (value) ? value.replace(/<\/?[a-zA-Z]+>/gi,'') : 'Фну'
}

export default prepareSummary;
